let fGenerateMap = function() {
    
    if (oMap) return;
    
    sMap = sMap.replace(/:/g, "':'%").replace(/,/g, "','%");
    oMap = (new Function('', "return {'" + sMap + "'};"))();
    
};

let decodeURItoEUCKR = function(sStr) {
    
    fGenerateMap();
    
    return decodeURI(sStr.replace(/(%[0-9a-f]{2}%[0-9a-f]{2})/ig, function(_, sKey) {
        return oMap[sKey] || _;
    }));

};

let encodeEUCKRtoURI = function(euckrStr) {
    
    fGenerateMap();

    let oArray = Object.entries(oMap);

    return encodeURI(euckrStr).replace(/(%[0-9a-f]{2}%[0-9a-f]{2}%[0-9a-f]{2})/ig, function(_) {
        let foundedEncodeValue = "";
        let founded = false;
        for (let a = 0; a < oArray.length; a++) {
            let oArraySearch = oArray[a];
            for (let b = 0; b < oArraySearch.length; b++) {
                if(oArraySearch[b] == _) {
                    founded = true;
                    break;
                }
                foundedEncodeValue = oArraySearch[b];
            }
            if(founded) {
                break;
            }
        }
        return foundedEncodeValue || _;
    });

};

